import React from "react";
import NavBar from "../components/NavBar";
import { AuthProvider } from "../contexts/AuthContext";

const Layout = ({ children }) => {
  return (
    <div>
      <AuthProvider
        value={{
          currentUser,
          setCurrentUser,
          token,
          setToken,
          login,
          logout,
        }}
      >
        <NavBar />
        {children}
      </AuthProvider>
    </div>
  );
};

export default Layout;
